import React, { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";
import { Button, Spin, Alert } from 'antd';
import axios from 'axios';

const AdministracionDeCuentasAjustador = () => {
  const navigate = useNavigate();
  const [nombres, setNombres] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/Login');
  };

  useEffect(() => {
    const Id = localStorage.getItem('Id_Usuario');
    const token = localStorage.getItem('token');

    const obtenerImagenDeUsuario = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/Ajustadores/ConsultarAjustadoresPorId/${encodeURIComponent(Id)}`, {
          headers: {
            'Authorization': token
          }
        });
        console.log("Respuesta de la consulta:", response.data);

        // Verificar si la respuesta contiene los nombres del ajustador
        if (response.data && response.data.registro && response.data.registro.Nombres) {
          setNombres(response.data.registro.Nombres);
        } else {
          setError('No se encontraron nombres de ajustador en la respuesta');
        }
      } catch (error) {
        console.error('Error al obtener la imagen del usuario:', error);
        setError('Error al obtener la información del ajustador');
      } finally {
        setLoading(false); // Marcar como cargado, ya sea con éxito o error
      }
    };

    obtenerImagenDeUsuario();
  }, []);

  if (loading) {
    return <Spin size="large" />;
  }

  if (error) {
    return <Alert message={error} type="error" />;
  }

  return (
    <div style={{ padding: '20px' }}>
      <h1>Administración de Cuentas de Ajustador</h1>
      <div>
        {nombres && (
          <p>Bienvenido, {nombres}</p>
        )}
        <Button type="primary" onClick={handleLogout} style={{ marginRight: 16 }}>
          Cerrar Sesión
        </Button>
      </div>
    </div>
  );
};

export default AdministracionDeCuentasAjustador;
